import './App.css';
import AdditionalInfo from './components/AdditionalInfo';
import DateField from './components/DateField';
import PlaceChoiceFields from './components/PlaceChoiceFields'
import SendAndClear from './components/SendAndClear';

function App() {
  const mainWindowStyle = { backgroundColor: 'blue', height: '100vh' };
  const elementsDivStyle = { display: 'flex', flexDirection: 'column', position: 'absolute', backgroundColor: 'brown', width: '70%', height: '80%', top: '0', left: '0', transform: 'translate(-50%, -50%)' };
  return (
    <div className='mainWindow' style={mainWindowStyle}>
      <div className="App" style={elementsDivStyle}>
        <PlaceChoiceFields />
        <DateField />
        <AdditionalInfo />
        <SendAndClear />
      </div>
    </div>
  );
}

export default App;
